import React from 'react'
import TextField from "@material-ui/core/TextField"
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { AppBar } from '@material-ui/core';
import Button from "@material-ui/core/Button"



export class EmailAndDob extends React.Component {
continue = e => {
  e.preventDefault()
  this.props.nextStep()
}
back = e => {
  e.preventDefault()
  this.props.previousStep()
}
  render () {
    const {values,handleChange} =this.props
    return (
     <MuiThemeProvider>
     <React.Fragment>
      <AppBar title="email and date of birth"/>
     <TextField
      hintText="Enter email"
      floatingLabelText="email"
      onChange={handleChange("email")}
      defaultValue={values.email}
      margin="normal"
      variant="outlined"
      autoComplete="off"
      fullWidth
       required={true}
       style={{
          width: '50ch',
          align:'center'
         }}
      />
      <br/>
           <TextField
      hintText="Enter the date of birth"
      floatingLabelText="Date of birth"
      onChange={handleChange("dob")}
      defaultValue={values.dob}
      margin="normal"
      variant="outlined"
      autoComplete="off"
      fullWidth
      required={true}
      style={{
          width: '50ch',
          align:'center'
         }}
      />
      <br/>

      <br/>
      <Button 
      type="submit"
      variant="contained" 
       color="primary" 
      style= {{marginTop:"1rem"}}
      onClick={this.continue}
      style={{
          width: '50ch',
          align:'center'
         }}
      >
          Next
      </Button>
        <Button 
      type="submit"
      variant="contained" 
      color="secondary" 
      style= {{marginTop:"1rem"}}
      onClick={this.back}
      style={{
          width: '50ch',
          align:'center'
         }}
      >
          Back
      </Button>
     </React.Fragment>
     </MuiThemeProvider>



    )
  }
}


 const styles = {
root: {
    flexGrow: 1,
},
grow: {
    flexGrow: 1,
},
menuButton: {
    marginLeft: -12,
    marginRight: 20,
},

    input: {
        color: 'white'

    }

};
export default EmailAndDob
